<#
# Script Name: RFC-TriageCollect
# Author: RFC1918

# Description: This PowerShell script serves as a wrapper for MagnetRESPONSE, designed to automate the collection and creation of a triage image from a host system. The script drops the necessary binaries (such as MagnetRESPONSE and 7zip), executes them to generate a triage image, and prepares the output for later copying. It can be utilized as a standalone tool or integrated into various EDR platforms that support PowerShell execution, allowing seamless use in live response scenarios.

#>

# Parameters (Optional)
param (
    [ValidateSet("Default")]
    [string]$CollectionProfile = "Default",
    [string]$CaseReference = "", 
    [switch]$Compress
)

# Constants
$TimeStamp = Get-Date -Format "yyyy-MM-dd_HH-mm-ss"
if ($CaseReference -eq "") {
    $CaseReference = "RFC-TriageCollect-$Timestamp"
} 
$OutputPath = "C:\Windows\debug\$CaseReference"
$LogFile = "$OutputPath\$CaseReference.log"

## Hardcoded Binaries

<#
Added new versions 

Download latest versions
https://7-zip.org/download.html
https://www.magnetforensics.com/resources/magnet-response/

Encode base64 
[Convert]::ToBase64String([IO.File]::ReadAllBytes(".\MagnetRESPONSE.exe")) | clip
Get-FileHash .\MagnetRESPONSE.exe
