Get-FileHash .\7z2408-extra\7za.exe

Replace base64 strings
#>

### Magnet RESPONSE v1.71 [September 7, 2024]
$MagnetResponseBin = ""
$MagnetResponseChecksum = "341A42C9D95855CC62456EF30ECAD14F922E11CBC8374E83B4F758A6DBECC9DE"

### 7za.exe 24.08 2024-08-11
$7zaBin = ""
$7zaChecksum = "CF878BFBD9ED93DC551AC038AFF8A8BBA4C935DDF8D48E62122BDDFDB3E08567"

# Helper functions
function Header {
    param (
        [string]$title
    )
    $border = "-" * ($title.Length + 4)
    Write-Host ""
    Write-Host "+$border+" -ForegroundColor Cyan
    Write-Host "|  $title  |" -ForegroundColor Cyan
    Write-Host "+$border+" -ForegroundColor Cyan
    Write-Host ""
}

# Prequirements
Start-Transcript -Path $LogFile -Append
$ProgressPreference = "SilentlyContinue"

Write-Host ""
Write-Host "RFC-TriageCollect" -ForegroundColor Cyan
Write-Host "Author: RFC1918" -ForegroundColor Cyan

## Check if we running with Administrator privileges
if (-not ([Security.Principal.WindowsPrincipal][Security.Principal.WindowsIdentity]::GetCurrent()).IsInRole([Security.Principal.WindowsBuiltInRole] "Administrator")) {
    Write-Warning "You need to run this script as an Administrator"
    exit
}

## Create output path 
if (-not (Test-Path $OutputPath)) {
    New-Item -Path $OutputPath -ItemType Directory | Out-Null
}

# Main functions
Header("System Information")
# Get System Information
$SystemInfo = Get-WmiObject -Class Win32_ComputerSystem
Write-Host "Manufacturer:       $($SystemInfo.Manufacturer)"
Write-Host "Model:              $($SystemInfo.Model)"
Write-Host "Name:               $($SystemInfo.Name)"
Write-Host "Domain:             $($SystemInfo.Domain)"

Header "OS Information"
# Get OS Information
$OSInfo = Get-WmiObject -Class Win32_OperatingSystem
Write-Host "OS Name:            $($OSInfo.Caption)"
Write-Host "OS Version:         $($OSInfo.Version)"
Write-Host "OS Architecture:    $($OSInfo.OSArchitecture)"

## Drop binaries to disk
Header("Writing binaries to disk")

if ($Compress) {
    Write-Host "Writing 7za.exe to $OutputPath"
    $7za = [System.Convert]::FromBase64String($7zaBin)
    $7zaPath = "$OutputPath\7za.exe"
    [System.IO.File]::WriteAllBytes($7zaPath, $7za)

    $checksum = Get-FileHash -Algorithm SHA256 -Path $7zaPath | Select-Object -ExpandProperty Hash
    Write-Host "`n - Checksum $checksum"

    if ($7zaChecksum -eq $checksum) {
        Write-Host " - 7za.exe checksum is valid`n"
    } else {
        Write-Host " - 7za.exe checksum invalid. Exiting ...`n"
        exit
    }
}

Write-Host "Writing MagnetResponse.exe to $OutputPath"
$MagnetResponse = [System.Convert]::FromBase64String($MagnetResponseBin)
$MagnetResponsePath = "$OutputPath\MagnetResponse.exe"
[System.IO.File]::WriteAllBytes($MagnetResponsePath, $MagnetResponse)

$checksum = Get-FileHash -Algorithm SHA256 -Path $MagnetResponsePath | Select-Object -ExpandProperty Hash
Write-Host "`n - Checksum $checksum"

if ($MagnetResponseChecksum -eq $checksum) {
    Write-Host " - MagnetResponse.exe checksum is valid`n"
} else {
    Write-Host " - MagnetResponse.exe checksum invalid. Exiting ...`n"
    exit
}

## Run MagnetReponse to collect artifacts
Header("Running MagnetResponse to collect artifacts")

$CollectionArguments = @()
if ($CollectionProfile -eq "Default") {
    $CollectionArguments += "/capturevolatile"# /capturesystemfiles /captureram"
    Write-Host "Default collection method selected`n`n - Arguments: $CollectionArguments"
}

$stopwatch = [System.Diagnostics.Stopwatch]::StartNew()
& "$MagnetResponsePath" -c "/accepteula /unattended /silent /caseref:$CaseReference /output:`"$OutputPath`" $CollectionArguments"
Wait-Process -Name "MagnetRESPONSE"
$null = $stopwatch.Elapsed
$minutes = $stopwatch.Elapsed.Minutes
$seconds = $stopwatch.Elapsed.Seconds
Write-Host "`nMagnetResponse capture completed!`n`n - Completed in $minutes minutes and $seconds seconds"

if ($Compress) {
    Header("Compressing artifacts")

    $CollectionPath = Get-ChildItem -Path "$OutputPath\$CaseReference*" -Directory | Select-Object -ExpandProperty FullName
    $CollectionZip = "$OutputPath\$(Split-Path -Leaf $CollectionPath).7z"

    $stopwatch = [System.Diagnostics.Stopwatch]::StartNew()
    & $7zaPath a -t7z -v3g $CollectionZip $CollectionPath
    $null = $stopwatch.Elapsed
    Write-Host "`nCompression completed!"
    $minutes = $stopwatch.Elapsed.Minutes
    $seconds = $stopwatch.Elapsed.Seconds
    Write-Host " - Completed in $minutes minutes and $seconds seconds"
}

Header("Output Details")
Write-Host "`nOutput Path: $OutputPath"
Write-Host "Folder checksum:" 
Get-FileHash -Algorithm SHA256 -Path (Join-Path -Path $OutputPath -ChildPath "*") -ErrorAction SilentlyContinue
Write-Host ""

Stop-Transcript